import Logo from "../../src/ecdis.jpg";

export default function Map() {
  return (
    <div>
      <section className="w-full h-screen">
        <img
          src={Logo}
          className="object-cover w-full h-full"
          alt="Image alt text"
        />
      </section>
    </div>
  );
}
